            services.AddControllers();
        }
</code></pre>

<p>But as I supposed It doesn't work this way..</p>

<p>I'm not going to paste all the other code since it's more or less a copy-paste from the microsoft guide, with renamed variables. But let me know if you need more details.</p>

<p>To make it short, I don't get where I need to put the reference to access the other collections.
