How to calculate $avg of array items in MongoDB aggregation?<p>i am building up a <code>mongodb</code> <code>aggregation</code> query in which i have a computed field(array) of numeric values. And i have to find avg of the whole array field. My <code>mongodb</code> aggregation query is like this</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>[{$match: {
  nsp: '/globalintltd.com',
  agentEmail: 'ahmed1549@globalintltd.com'
}}, {$lookup: {
  from: 'messages',
  let : {cid : '$_id'},
  pipeline:[
    {
      $match : {
        $expr:{
          $eq: ['$cid', '$$cid'],
        },
        type: 'Agents'
      }
    },
    {$limit : 1}
  ],
  as: 'messages'
}}, {$project: {
  agentEmail: 1,
  convDate: {
    $dateFromString:{
      dateString: '$createdOn'
    }
  },
  firstReplyDate:{
    $dateFromString:{
      dateString:{
        $arrayElemAt:['$messages.date', 0]
      }
    }
  }
}}, {$addFields: {
  difference: {
    $divide:[
      {
         $subtract:[
    '$firstReplyDate',
    '$convDate'
    ] 
      },
      60000
    ]
  }
}}, {$group: {
  _id: {
    "agentEmail" : "$agentEmail"
  },
  AgentFirstResponses : {
    $push : "$difference"  
  }
}}]</code></pre>
</div>
</div>
</p>

<p>from above query i am getting results like this</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>[
  {agentEmail : "ahmed1549@globalintltd.com", convId : 3434345111, AgentFirstResponses : [33.54,65.65,9.087,5.43]},
