MongoDB $dateToString format expression %G strange behaviour<p>I have a document that has the following property amongst others</p>

<pre><code>{
 dueDate: ISODate("2019-12-29T13:00:00.000Z")
}
</code></pre>

<p>I'm building an aggregation, and in the $project stage, I am attempting the following:</p>

<pre><code> "utcDueDate": "$dueDate",
 "rawDueDate" : {
        "$dateToString" : {
            "date" : "$dueDate", 
            "timezone" : "Australia/Sydney"
        }
    }, 
    "prettyDueDate" : {
        "$dateToString" : {
            "date" : "$dueDate", 
            "format" : "%d/%m/%G", 
            "timezone" : "Australia/Sydney"
        }
    }
</code></pre>

<p>I am expecting the following output:</p>

<ul>
<li><p>utcDueDate: 2019-12-29T13:00:00.000Z</p></li>
<li><p>rawDueDate: 2019-12-30T00:00:00.000Z</p></li>
<li><p>prettyDueDate: 30/12/2019</p></li>
</ul>

<p>However, I am getting <strong>30/12/2020</strong> for prettyDueDate. </p>

<p>If I use %Y instead of %G it works as expected. </p>

<p>%G is meant to be the ISO standard format for year (0000-9999). I am using mongo version 4.0.13</p>

<p>Can anyone please explain why this is happening? Quite a few aggregations that are used for reporting have this format string and I'd really like to avoid having to change them all</p>

